class Solution:
    def solution(self, m, n, a):

        def feasible(m, n, a):
            A = a
            B = m
            C = n

            if A>B:
                A,B = B,A
            if A>C:
                A,C = C,A
            if B>C:
                B,C = C,B

            return A == B == C

        if m == 0:
            return 0

        for i in range(m):
            if a[i]<=n:
                n = n - a[i]
            else:
                return -1

        return n if feasible(m, n, a) else -1


