class Brainfuck(object):
    def __init__(self, expression: str):
        self.expression = expression
        self.memory = [0] * 30000
        self.pointer = 0
        self.steps = 0
        self.stack = []

    def execute(self, input_: str) -> str:
        self.input = input_
        for char in self.expression:
            if char == '+':
                self.increase()
            elif char == '-':
                self.decrease()
            elif char == '<':
                self.move_left()
            elif char == '>':
                self.move_right()
            elif char == '.':
                self.print_()
            elif char == ',':
                self.take_input()
            elif char == '[':
                self.check_bracket()
            elif char == ']':
                self.left_bracket()
            else:
                continue
        return self.output

    def increase(self):
        if self.pointer + 1 < len(self.memory):
            self.memory[self.pointer] += 1
            if self.memory[self.pointer] > 255:
                self.memory[self.pointer] = 0
        else:
            self.memory.append(0)
        self.pointer += 1

    def decrease(self):
        if self.pointer - 1 >= 0:
            self.memory[self.pointer] -= 1
            if self.memory[self.pointer] < 0:
                self.memory[self.pointer] = 255
        else:
            self.memory.insert(0, 255)
        self.pointer -= 1

    def move_right(self):
        self.pointer += 1

    def move_left(self):
        self.pointer -= 1

    def print_(self):
        self.output += chr(self.memory[self.pointer])

    def take_input(self):
        self.memory[self.pointer] = ord(self.input[0])
        self.input = self.input[1:]

    def check_bracket(self):
        if self.memory[self.pointer] == 0:
            self.pointer += 1
            while True:
                if self.pointer == len(self.memory):
                    raise IndexError
                if self.memory[self.pointer]!= 0:
                    break
                self.pointer += 1

    def left_bracket(self):
        if self.memory[self.pointer]!= 0:
            self.pointer -= 1
            while True:
                if self.pointer == -1:
                    raise IndexError
                if self.memory[self.pointer]!= 0:
                    break
                self.pointer -= 1
        else:
            self.pointer -= 1
            while True:
                if self.pointer == -1:
                    raise IndexError
                if self.memory[self.pointer]!= 0:
                    break
                self.pointer -= 1

    def print_memory(self):
        return self.memory

