class Bamboo:
    def __init__(self, length: int):
        self.length = length

    def __repr__(self):
        return f"Bamboo of length {self.length}"

    def extension_magic(self) -> Magic:
        return Magic(1, self.length + 1)

    def shortening_magic(self) -> Magic:
        return Magic(1, max(self.length - 1, 0))

    def composition_magic(self, other: 'Bamboo') -> 'Bamboo':
        return Bamboo(self.length + other.length)


class BambooSystem:
    def __init__(self, length: int, magic: dict):
        self.length = length
        self.magic = magic

    def __repr__(self):
        return f"BambooSystem of length {self.length}"

    def get_bamboo(self, length: int) -> Bamboo:
        return Bamboo(length)

    def get_magic(self, magic_type: int) -> Magic:
        return self.magic[magic_type]

    def get_cost(self, bamboo: Bamboo) -> int:
        result = 0
        for magic_type in self.magic.values():
            if magic_type.magic_type == 3 and bamboo.length > magic_type.value:
                if magic_type.value > self.length:
                    return 10 ** 5
                result += 10
            if magic_type.magic_type == 1 and self.length - 1 > bamboo.length:
                result += 1
        return result

    def get_min_cost(self, previous_bamboo: Bamboo, previous_cost: int) -> int:
        if previous_bamboo.length == self.length:
            return previous_cost
        if previous_bamboo.length > self.length:
            return 10 ** 5

        min_cost = 10 ** 5
        for magic_type in self.magic.values():
            if magic_type.magic_type == 1:
