                new_bamboo = self.get_bamboo(self.length)
                new_cost = self.get_cost(new_bamboo)
                min_cost = min(min_cost, new_cost + self.get_min_cost(new_bamboo, previous_cost))
            if magic_type.magic_type == 2:
                if previous_bamboo.length + 1 > self.length:
                    continue
                new_bamboo = self.get_bamboo(self.length)
                new_cost = self.get_cost(new_bamboo)
                min_cost = min(min_cost, new_cost + self.get_min_cost(new_bamboo, previous_cost))
