        X, N = int(X), int(N)
        L = list(map(int, stdin.split('\n')[0].split(' ')))
        return sum(1 for i in range(1, N+1) if X < sum(L[:i]))

    # Solution 2
    # O(n) time, O(n) space
    def solution2(self, stdin: str) -> str:
        X, N = stdin.split(' ')
        X, N = int(X), int(N)
        heap = [(0,0)]
        count = 0
        while heap:
            distance, idx = heapq.heappop(heap)
            if distance > X:
                break
            if idx == N:
                count += 1
            else:
                heapq.heappush(heap, (distance + L[idx], idx + 1))
        return count

