-----Explanation-----

The first example:

- The cans are numbered from left to right from $1$ to $3$.
- The first can is $20$, the second is $10$, and the third one is $20$.
- For the first can it's $20 \cdot 1 + 1 = 21$ shots are needed.
- After that only second can remains and he needs $10 \cdot 2 + 1 = 21$ shots.
- After that only third can remains and he needs $20 \cdot 3 + 1 = 43$ shots.
- In total the number of shots is $1 + 21 + 21 = 43$.

The second example:

- The cans are numbered from left to right from $1$ to $4$.
- The first can is $10$, the second is $10$, the third one is $10$, and the fourth one is $10$.
- All cans have the same durability so any order of shooting is enough.
- In total the number of shots is $64$.


