var solution = function(stdin) {
    const cans = stdin.split('\n')[0].split(' ');
    const canDur = [...Array(cans.length).fill(1)];

    let index = 0;
    while(index < canDur.length) {
        let count = 0;
        while(count < canDur[index]) {
            count += cans[index];
            index++;
            if(index >= canDur.length) break;
        }
    }

    const ans = [];
    let max = 0;
    for(let i = 0; i < canDur.length; i++) {
        if(canDur[i] > max) {
            max = canDur[i];
            ans = [i];
        }
        else if(canDur[i] == max) {
            ans.push(i);
        }
    }
    return ans.join(' ');
}

