class Solution:
    def longestPalindrome(self, s: str) -> str:
        def longestPalindromicSubstr(s: str) -> str:
            if len(s) == 1:
                return s

            n = len(s)
            for k in range(n - 1, 1, -1):
                for i in range(n - k):
                    substr = s[i:i + k + 1]

                    if substr == substr[::-1]:
                        return substr
            return s[0]
        res = s[0]
        for i in range(1, len(s)):
            substr = longestPalindromicSubstr(s[:i + 1])
            if len(substr) > len(res):
                res = substr
        return res


