    def __init__(self):
        self.tree = []

    def load_from_string(self, in_str):
        self.tree = [list(map(int, line.strip().split())) for line in in_str.strip().split('\n')]

    def load_from_file(self, filename):
        with open(filename) as file:
            self.load_from_string(file.read())

    def load_from_json(self, filename):
        with open(filename) as file:
            self.tree = json.load(file)

