        with open(filename, 'w') as file:
            json.dump(self.tree, file)

    def is_edge(self, u, v):
        return u in [edge[0] for edge in self.tree] and v in [edge[1] for edge in self.tree]

    def is_neighbor(self, u, v):
        return u in [edge[1] for edge in self.tree] and v in [edge[0] for edge in self.tree]

    def get_neighbors(self, u):
        return [edge[1] for edge in self.tree if edge[0] == u]

    def get_color(self, u):
        for edge in self.tree:
            if edge[0] == u:
                return edge[2]
        return None

    def get_children(self, u):
        return [edge[0] for edge in self.tree if edge[1] == u]

    def get_parents(self, u):
        return [edge[1] for edge in self.tree if edge[0] == u]

    def get_edge_color(self, u, v):
        return [edge[2] for edge in self.tree if edge[0] == u and edge[1] == v][0]

    def get_edges(self):
        return set([edge[:2] for edge in self.tree])

    def get_vertices(self):
        return set([edge[0] for edge in self.tree] + [edge[1] for edge in self.tree])

