        return "Node({}, {})".format(self.key, self.value)

class DoubleLinkedList(object):
    def __init__(self):
        self.head = None
        self.tail = None

    def __repr__(self):
        return "DoubleLinkedList({})".format(self.to_list())

    def to_list(self):
        if not self.head:
            return []
        res = []
        curr = self.head
        while curr:
            res.append(curr.key)
            curr = curr.next
        return res

    def append(self, node):
        if self.head is None:
            self.head = node
            self.tail = node
        else:
            self.tail.next = node
            node.prev = self.tail
            self.tail = node

    def prepend(self, node):
        if self.head is None:
            self.head = node
            self.tail = node
        else:
            node.next = self.head
            self.head.prev = node
            self.head = node

    def remove_node(self, node):
        if node.prev:
            node.prev.next = node.next
        else:
            self.head = node.next
        if node.next:
            node.next.prev = node.prev
        else:
            self.tail = node.prev

class LRUCache(object):

    def __init__(self, capacity):
